import React from "react";
import './FaceRecognition.css';

const FaceRecognition = ({boxes, imageUrl}) => {
    return (
        <div className="center ma">
            <div className="absolute mt3">
                <img id="inputimage" src={imageUrl} alt="face recognition" width='500px' height='auto' />
                {boxes.map((box, index) => {    // map through the boxes array and return a div for each box
                    return <div key={index} className="bounding-box" style={{top: box.topRow, right: box.rightCol, bottom: box.bottomRow, left: box.leftCol}}></div>
                })}
            </div>
        </div>
    );
    }


export default FaceRecognition;
